import React from 'react';
import { BrowserRouter, Route, Switch } from 'react-router-dom';
import './App.css';

function App() {
  return (
    <div className="App">
      <h2>Shared header</h2>
      <BrowserRouter>
        <Route path="/">
          <TempScreen title="Home screen"/>
        </Route>
        <Route path="/work">
          <TempScreen title="Work screen"/>
        </Route>
        <Route path="/projects">
          <TempScreen title="Projects screen"/>
        </Route>
      </BrowserRouter>
    </div>
  );
}

function TempScreen(props){

  return (
    <h1>This is the {props.title}</h1>
  )
}

export default App;
